const Notice = ({img, script}) => {
    return(
        <div className={Style.noticeCover}>
            <div className={Style.noticeImgCover}>
                <p className={Style.noticeImg}>{img}</p>
            </div>
            <div className={Style.noticeCover}>
                <p className={Style.notice}>{script}</p>
            </div>
        </div>
    );
}

